import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { ListGroup, ListGroupItem } from 'reactstrap';

class SearchResult extends Component {
	render(){ 
		const result = this.props.data;
		if(result===undefined || result.license===undefined){
			return null
		}else{
			let urlPrettyOrg = result.organization.toLowerCase().replace(/[^a-z0-9]+/g,'-');
			return (
				<ListGroupItem key={'licnumkey'+result.license}>
					<Link to={'/details/'+result.license+'/'+urlPrettyOrg}>
						<b>{result.organization}</b> <i>for now lets just dump it...</i>
						<pre>{JSON.stringify(result,null,2)}</pre>
					</Link>
				</ListGroupItem>
			)			
		}
	}
}

export default SearchResult;
